Και τι έπαθε ο Φιλιππιδης; Σταματησε να ειναι ο εαυτος του;
Μιλατε κοριτσια! Δεν σωνεται αλλιως η κατασταση!

Όταν είπαν για τον #Κιμούλης βγήκε στα κανάλια και τις έβγαλε τρελές. 
Όταν είπαν για τον #Σπυροπουλος έβγαλε το δικηγόρο και τη γκόμενα να λέει γιατί τώρα; 
Κι όταν είπαν για τον #Φιλιππιδης μπήκε προληπτικά στο νοσοκομείο. 
Ανθρωπάκια και δειλοί. 
Όταν τα κάνατε ήταν καλά;

Ένα λεπτό γιατί θα τρελαθούμε όλοι μαζί εδώ μέσα.
Το θέμα είναι η διαγραφή από τον ΣΕΗ ή το να μην ξανά πατήσουμε στα θέατρα όσων αποδειχθεί ότι έχουν κακοποιήσει με κάθε τρόπο άλλους συναδέλφους τους.;
Μην χάνουμε το νόημα στην μετάφραση. #Φιλιππιδης

